CREATE TABLE `licenses` (
  `id_licence` int(11) NOT NULL AUTO_INCREMENT,
  `client_id` int(11) NOT NULL,
  `status` int(2) DEFAULT NULL,
  `license_types_id` int(11) NOT NULL,
  `date_from` char(10) NOT NULL,
  `date_to` char(10) NOT NULL,
  `welcome_ms` text,
  `criteria` text,
  `banner` char(100) DEFAULT NULL,
  `bg_image` char(50) DEFAULT NULL,
  `color_bg` char(10) DEFAULT NULL,
  `name` varchar(100) NOT NULL,
  `subdomain` varchar(20) NOT NULL,
  `program_from` char(10) DEFAULT NULL,
  `program_to` char(10) DEFAULT NULL,
  `points` float DEFAULT '1',
  `last_step` int(9) DEFAULT NULL,
  `registration_page` int(1) DEFAULT NULL,
  `invitation_code` char(20) DEFAULT NULL,
  `registration_msg` text,
  `welcome_edm` text,
  `welcome_edm_title` char(250) DEFAULT NULL,
  `welcome_edm_from` char(100) DEFAULT NULL,
  `banner_edm` char(150) DEFAULT NULL,
  `lunch_date` datetime DEFAULT NULL,
  `lunch_by` int(11) DEFAULT NULL,
  `use_banner` int(1) DEFAULT NULL,
  `invitation_edm_title` char(100) DEFAULT NULL,
  `invitation_edm_text` text,
  `registration_limit_date` char(10) DEFAULT NULL,
  `max_participants` int(5) DEFAULT NULL,
