insert  into `licenses`(`id_licence`,`client_id`,`status`,`license_types_id`,`date_from`,`date_to`,`welcome_ms`,`criteria`,`banner`,`bg_image`,`color_bg`,`name`,`subdomain`,`program_from`,`program_to`,`points`,`last_step`,`registration_page`,`invitation_code`,`registration_msg`,`welcome_edm`,`welcome_edm_title`,`welcome_edm_from`,`banner_edm`,`lunch_date`,`lunch_by`,`use_banner`,`invitation_edm_title`,`invitation_edm_text`,`registration_limit_date`,`max_participants`,`program_admin_email`) values (1,5,6,1,'08-08-2014','22-08-2014','<p><strong>Better camera, more features</strong></p>\r\n<p>We now have a probable release date for the iPhone 6 and it isn\'t far off; 9 September seems to be the anointed&nbsp;day, but what can we expect from Apple\'s flagship device?</p>\r\n<p>Here is a brief rundown of the features everyone is talking about.</p>\r\n<p>The last new iPhone, the 5s, was a revamp of the previous model, but this model will be something different altogether.</p>\r\n<p><strong>Bigger</strong></p>\r\n<p>The rumours are that the new iPhone will come in two sizes: a 4.7-inch model and a larger 5.5 inch device. Both are larger than the four-inch screen on the 5s. <a href=\"http://www.techradar.com/news/phone-and-communications/mobile-phones/iphone-6-release-date-news-and-rumours-1099865\">According to Tech Radar</a>&nbsp;there may be some problems with the production of the larger model and it is not clear if both handsets will hit the shelves in tandem.</p>\r\n<p>There has even been talk of three sizes, with a cheaper iPhone 5c upgrade added to the party.</p>\r\n<p><strong>Better camera, more features</strong></p>\r\n<p>There are indications that Apple is going big with its camera this time, perhaps adding a 13-mega-pixel sensor which is smaller and clearer. This is far from clear and it may be possible that the iPhone 6 has only slightly more pixels but a better quality camera. The new operating system, iOS8, is brimming with photo editing options.&nbsp;</p>\r\n<p>There are a few intriguing patents that people like to speculate about and Tech Radar says that wireless charging remains a possibility. It isn\'t holding its breath though.</p>\r\n<p>Perhaps most excitingly <a href=\"http://www.idownloadblog.com/2012/12/10/iphone-5s-june-2013/\">some sites are reporting</a> Apple will add near-field communication (NFC)&nbsp;to the iPhone 6, allowing for contactless payments and maybe Oyster-like travel.&nbsp;</p>','<h3 style=\"margin: 0px; padding: 3px 60px 1px; line-height: 20px; font-size: 16px; font-weight: bold; color: #0c3d5d; font-family: \'Open Sans\', Arial, sans-serif; font-style: normal; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">Program Period</h3>\r\n<p style=\"margin: 10px 0px; padding: 0px 60px; line-height: 30px; font-size: 16px; color: #252525; font-family: \'Open Sans\', Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">Program From dd/mm/yy to dd/mm/yy.</p>\r\n<h3 style=\"margin: 0px; padding: 3px 60px 1px; line-height: 20px; font-size: 16px; font-weight: bold; color: #0c3d5d; font-family: \'Open Sans\', Arial, sans-serif; font-style: normal; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">Eligibility</h3>\r\n<p style=\"margin: 10px 0px; padding: 0px 60px; line-height: 30px; font-size: 16px; color: #252525; font-family: \'Open Sans\', Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">This incentive program is open for all Sales Consultants Participants of this incentive program must achieve the following criteria in order to receive a reward.<br style=\"margin: 0px; padding: 0px; line-height: 20px;\" />To earn a reward you must:</p>\r\n<ul style=\"margin: 0px; padding: 0px 0px 0px 78px; line-height: 20px; color: #000000; font-family: \'Open Sans\', Arial, sans-serif; font-size: 16px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">\r\n<li style=\"margin: 0px; padding: 2px 0px; line-height: 24px; list-style-type: circle;\">Achieve 100% of your target</li>\r\n<li style=\"margin: 0px; padding: 2px 0px; line-height: 24px; list-style-type: circle;\">Achieve a minimum of 20 units of this specific product</li>\r\n<li style=\"margin: 0px; padding: 2px 0px; line-height: 24px; list-style-type: circle;\">Complete the training provided during this year</li>\r\n</ul>\r\n<p style=\"margin: 10px 0px; padding: 0px 60px; line-height: 30px; font-size: 16px; color: #252525; font-family: \'Open Sans\', Arial, sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;\">Everybody that completes the above criteria will receive a reward</p>','bn-1-5.jpg','Apple-Prods.png','#cacaca','Iphone 6','iphone6','08-08-2014','21-08-2014',2,5,NULL,'COD51','Please register to get the iphone messages. ','<p>Hey,</p>\r\n<p>Register for this program to get the iphone 6</p>','Iphone 6 Program','admin@ad-inc.com.au','edm-1-5.jpg','2014-08-08 01:08:52',27,1,'Iphone 6 invitaion','<p>Hello</p>\r\n<p>&nbsp;</p>\r\n<p>You are invited to join iphone 6 program</p>','20-08-2014',1000,NULL),(2,2,6,1,'08-08-2014','31-08-2014','<div class=\"container-narrow\">\r\n<div id=\"content_load\" class=\"content\">\r\n<h1 style=\"text-align: center;\"><span style=\"font-family: helvetica; font-size: 18pt; color: #3366ff;\">\"All our dreams come true, if we have the courage to pursue them\"<em> Walt Disney</em></span></h1>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: helvetica; font-size: 12pt;\">The \"Think New\" Incentive program will take the top 23 dealerships to the City of Angels where they attend a customised training at the world renowned Disney Institute.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: helvetica; font-size: 12pt;\">Recognised for providing outstanding corporate solutions that inspire, innovate and create lasting change - the Disney Institute will provide the tools to take your dealership to the next level.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: helvetica; font-size: 12pt;\">The 5-day Toyota Disney Institute Study Tour includes:</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: helvetica; font-size: 12pt;\">&nbsp;</span><span style=\"font-family: helvetica; font-size: 12pt;\">Return flights to Los Angeles</span></p>\r\n<ul style=\"text-align: justify;\">\r\n<li><span style=\"font-family: helvetica; font-size: 12pt;\">4 nights accommodation</span></li>\r\n<li><span style=\"font-family: helvetica; font-size: 12pt;\">All meals</span></li>\r\n<li><span style=\"font-family: helvetica; font-size: 12pt;\">3 days of customised training and strategic planning at the world renowned Disney Institute</span></li>\r\n</ul>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: helvetica; font-size: 12pt;\">&nbsp;So, keep those numbers up and good luck.</span></p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: helvetica; font-size: 12pt;\">The Think New Disney Institute Incentive will provide the attendees with three days of Customised training and strategic planning at the Disney Institute in Los Angeles. Study Tour duration is 5 days and 4 nights.</span></p>\r\n</div>\r\n</div>','<h3><span style=\"font-size: 12pt; font-family: helvetica;\">Eligibility</span></h3>\r\n<p><span style=\"font-size: 12pt; font-family: helvetica;\">All current authorised Toyota Dealerships.</span></p>\r\n<h3>Participants</h3>\r\n<p>All current Sales Society/Network Central Registered Dealership Managers.</p>\r\n<h3>Minimum Qualification Criteria</h3>\r\n<p>A Dealership must RDR a minimum of 15 Total Nett units and a minimum of 5 Nett LM Sales units over the program period.</p>\r\n<h3>Criteria</h3>\r\n<p align=\"center\"><img src=\"http://utility.adincentives.com.au/disney/staging/images/criteria-table.png\" alt=\"\" width=\"500\" height=\"136\" /></p>\r\n<h3>Winning Criteria</h3>\r\n<p>Top 23 Dealerships, based on Dealers achieving 100% or greater of their LM Nett target over the program period AND then ranked according to Total Nett target achievement over program period by Weight &amp; Region.</p>','bn-2-2.png','bright-squares.png','#191719','Think New 2','test2','09-08-2014','31-08-2014',3,2,1,'COD22','The \"Think New\" Incentive program will take the top 23 dealerships to the City of Angels where they attend a customised training at the world renowned Disney Institute.\r\n\r\na change','<p>Toyota For Life is now a reality with everyone throughout the Toyota network thinking and talking about it.</p>\r\n<p>To align with this we are excited to launch the &ldquo;Think New 2 &ndash; Disney Institute Program&rdquo; - a Dealership incentive that rewards the 23 top achieving Dealerships with a place at the Disney Institute&rsquo;s customised training program in Los Angeles.</p>\r\n<p>This incentive program runs from 1st August &ndash; 30th September 2014 and is aligned with the Toyota For Life developments. For the first time, target achievement<strong> will not </strong>be a criteria to determine the 23 Dealership places. Instead, we will trial new KPIs that are balanced between market performance, Customer Satisfaction and Toyota&nbsp;</p>\r\n<p>The 23 Dealership places will be highly sought after and to secure one of these places you need to ensure your team is aware and focused on the new criteria. This will set you up for success not just in this program but also for the future.</p>\r\n<p>With the Franchise of the Future vision now a focus for all, this is the perfect time to ensure your Dealership is aligned and ready to take the next step towards achieving even greater success.</p>\r\n<p>We wish you all the best in this program and hope to see you at the Disney Institute.</p>','Think New 2 Title','admin@ad-inc.com.au','edm-2-2.png','2014-08-08 01:08:52',28,1,'Invitation title','<p>Toyota For Life is now a reality with everyone throughout the Toyota network thinking and talking about it.</p>\r\n<p>To align with this we are excited to launch the &ldquo;Think New 2 &ndash; Disney Institute Program&rdquo; - a Dealership incentive that rewards the 23 top achieving Dealerships with a place at the Disney Institute&rsquo;s customised training program in Los Angeles.</p>\r\n<p>&nbsp;</p>\r\n<p><a href=\"/public/client/program/setup/licence/disney.motive8dev.adincentives.com.au\">disney.motive8dev.adincentives.com.au</a></p>\r\n<p>This incentive program runs from 1st August &ndash; 30th September 2014 and is aligned with the Toyota For Life developments. For the first time, target achievement<strong> will not </strong>be a criteria to determine the 23 Dealership places. Instead, we will trial new KPIs that are balanced between market performance, Customer Satisfaction and Toyota&nbsp;</p>\r\n<p>The 23 Dealership places will be highly sought after and to secure one of these places you need to ensure your team is aware and focused on the new criteria. This will set you up for success not just in this program but also for the future.</p>\r\n<p>With the Franchise of the Future vision now a focus for all, this is the perfect time to ensure your Dealership is aligned and ready to take the next step towards achieving even greater success.</p>\r\n<p>We wish you all the best in this program and hope to see you at the Disney Institute.</p>','31-08-2014',9,'admin@admin.com.au'),(3,2,5,1,'12-08-2014','31-08-2014',NULL,NULL,NULL,NULL,NULL,'My incentive program','new',NULL,NULL,1,2,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,5,NULL);

