carpets  hard floors and upholstery. Dyson Cinetic cyclones capture the dust that clogs the bags and filters of other vacuum cleaners. No filters to wash or replace. Ball technology steers easily around obstacles and follows without the awkward moves. Carbon Fibre Turbine Head removes fine dust from hard floors and ground-in dirt from carpets. Includes Swivel Hard Floor Tool &amp; Mini Tangle-free Turbine Tool. ','Dyson','DC54ANIMAL','785.77','999','864.35','25.00','6640bcf427c75922d381df48c0af0636.jpg','2014-07-24 01:07:21','Enabled'),(14,1122,1,'5','35','Carbon Program Bike',' You can easily save yourself time and money when you use this BH Fitness Carbon Program Exercise Bike! Measuring 115cm (L) x 54cm (W) x 153cm (H) and weighing only 53kg  this handy bike can be wheeled around your home so you stay comfortable and motivated.&nbsp;Keep yourself challenged with this Carbon Program Exercise Bike\'s 12 pre-set and personal custom training profiles and 16 intensity levels.&nbsp;This BH Fitness bike\'s Recovery Test lets you monitor your progress. Its electronic monitor display lets you keep an eye on time  speed  distance  calories  revolutions per minute (RPM) and heart rate. Rely on this bike\'s handgrips and PLUS 4 Heart Rate Control Program to ensure your heart rate is at an optimum level for a satisfying workout. ','BH Fitness','H870','691.20','999','760.32','90.00','0b5015812af1ebb30d0c39964fdd3b37.jpg','2014-07-24 01:07:21','Enabled'),(15,1133,1,'2','6','Floor standing Bluetooth CD/MP3/WMA iPhone dock Clock/Alarm optional wall mount Emerald Green',' Rest with a new style of audio. Entertaining and energising  it\'s an endlessly enchanting companion. Bluetooth compatibility makes operation and placement smartly convenient. Stylish and wireless.&nbsp;With a sleek stand and minimal proportions  the ISX-B800 looks like a work of art. It was created by completely re-imagining the concept of a music source as part of the interior. The independent body style makes music an interior design element  and because the sides are slanted  it appears to be a thin panel. The front grille uses expanded metal  providing an attractive texture.&nbsp;The striped pattern printed underneath the grille conveys a feeling of depth  giving the impression that the music is coming from within the entire front surface. Merging beautifully into the living space  this is an entirely new audio form that you can match to your lifestyle.&nbsp;  *Bluetooth for wireless music streaming  alarm synchronisation and wireless remote control functionality.  *Single Slot CD Player *USB input for iOS Devices *3.5mm Aux input *Digital iPod/iPhone dock for lossless audio playback  *Wall mountable (with optional AT-800 bracket) ','Yamaha','ISXB820G','731.00','999','804.10','60.00','8a2cf3d50280445967a53aa21ed1c48f.jpg','2014-07-24 01:07:21','Enabled'),(16,1134,1,'2','6','Floor standing Bluetooth CD/MP3/WMA iPhone dock Clock/Alarm optional wall mount Magenta',' Rest with a new style of audio. Entertaining and energising  it\'s an endlessly enchanting companion. Bluetooth compatibility makes operation and placement smartly convenient. Stylish and wireless.&nbsp;With a sleek stand and minimal proportions  the ISX-B800 looks like a work of art. It was created by completely re-imagining the concept of a music source as part of the interior. The independent body style makes music an interior design element  and because the sides are slanted  it appears to be a thin panel. The front grille uses expanded metal  providing an attractive texture.&nbsp;The striped pattern printed underneath the grille conveys a feeling of depth  giving the impression that the music is coming from within the entire front surface. Merging beautifully into the living space  this is an entirely new audio form that you can match to your lifestyle.  *Bluetooth for wireless music streaming  alarm synchronisation and wireless remote control functionality.  *Single Slot CD Player *USB input for iOS Devices *3.5mm Aux input *Digital iPod/iPhone dock for lossless audio playback  *Wall mountable (with optional AT-800 bracket) ','Yamaha','ISXB820M','731.00','999','804.10','60.00','0ee723936af78391f5c0ce1adced508e.jpg','2014-07-24 01:07:21','Enabled'),(17,1135,1,'2','6','Floor standing Bluetooth CD/MP3/WMA iPhone dock Clock/Alarm optional wall mount White',' Rest with a new style of audio. Entertaining and energising  it\'s an endlessly enchanting companion. Bluetooth compatibility makes operation and placement smartly convenient. Stylish and wireless.&nbsp;With a sleek stand and minimal proportions  the ISX-B800 looks like a work of art. It was created by completely re-imagining the concept of a music source as part of the interior. The independent body style makes music an interior design element  and because the sides are slanted  it appears to be a thin panel. The front grille uses expanded metal  providing an attractive texture.&nbsp;The striped pattern printed underneath the grille conveys a feeling of depth  giving the impression that the music is coming from within the entire front surface. Merging beautifully into the living space  this is an entirely new audio form that you can match to your lifestyle.  *Bluetooth for wireless music streaming  alarm synchronisation and wireless remote control functionality.  *Single Slot CD Player *USB input for iOS Devices *3.5mm Aux input *Digital iPod/iPhone dock for lossless audio playback  *Wall mountable (with optional AT-800 bracket) ','Yamaha','ISXB820W','731.00','999','804.10','60.00','eaa8014f4db2e2798c2be84ca199a26c.jpg','2014-07-24 01:07:21','Enabled'),(18,1278,1,'7','42','Samsung Galaxy Note 3G Black',' Air Command - Hover the S Pen over the screen and simply press the pen button to instantly access 5 useful S Pen features: Action Memo turn your handwritten memos into actionable links: calls  new contacts  To-Dos or emails  web or location searches  tasks. For example  write down a telephone number  press Link to