81,630,1,'7','42','Xperia Z Handset - Black','  Experience razor sharp images and luminous colour with the Xperia&trade; Z\'s 1080p full HD resolution and immense 5in display. Combining a Snapdragon 1.50GHz processor with 2GB RAM and Android Jelly Bean OS  the Sony smartphone delivers amazingly fast operation  while its tempered glass exterior ensures it\'s both waterproof and dust-resistant.    Cinematic Visuals  For brilliant images bursting with vibrant colour and realism  look no further than the Xperia&trade; Z. Engineered using Sony Mobile BRAVIA&reg; Engine 2 technology  this smartphone delivers an unparalleled standard in picture quality. The Xperia&trade; Z pairs an incredibly high pixel density (443 pixels per inch) with a superior OptiContrast&trade; panel and colour management technology to offer you a cinematic  full HD experience on the small screen!  Exceptional Images  Achieve a new perfection in picture-taking with the Xperia&trade; Z\'s 13 megapixel camera. Now you can capture natural  vivid colours in any light with Sony\'s HDR (High Dynamic Range) and ExmorRS imaging technology - featured in both front and rear cameras. Designed to capture the image at varying exposure levels before merging these into one optimised image  Sony\'s advanced technology lets you record your memories in stunning clarity &ndash; whether at night or against strong backlight.  Advanced Technology  Ideal for gaming and online browsing  the Sony Xperia&trade; Z\'s 1.50GHz Snapdragon&trade; S4 Pro quad-core processor and 2GB of RAM offers you advanced graphics  incredibly fast performance and efficient battery use. Direct access to Playstation&reg;Mobile ensures you can browse and download the latest releases for gaming on the go.  Design  Take your smartphone on all your adventures with the Xperia&trade; Z\'s robust design. The large 5in screen is protected by an anti-shatter film while tempered glass is used for the front and back. Excelling in any situation due to its waterproof and dust-resistant (IP55 and IP57 rating) casing  the Sony can be submerged underwater for thirty minutes and still function perfectly! Despite its tough exterior  the Xperia&trade; Z boasts beauty in its perfectly proportioned OmniBalance design and slim 7.9mm depth.  ','Sony','040260 -','613.00','749.95','674.30','8.00','f9b9d77700bcd95ade1d53edddd685fe.jpg','2014-07-24 01:07:21','Enabled'),(182,584,1,'2','8','32in LED Dual Core Micro Dimming SMART TV Voice Control',' 32 inch LED 1920x1080  CRM400 100Hz  Dual Core  Micro Dimming  SMART TV  Voice Control  Web Browser  3D Conv  Allshare  WiFi  4HDMI  3USB ','Samsung','UA32F6400AMXXY','563.81','749','620.19','25.00','bf7d2a698e8d8c5bff3dbaf1399448a2.jpg','2014-07-24 01:07:21','Enabled'),(183,704,1,'2','8','42in LED TV LS54 Series',' 106cm/42inch FHD 50Hz Narrow Bezel Design MHL USB Movie Picture Wizard II Smart Energy Saving 2.0 Speaker 2HDMI &nbsp;1USB/1Headphone ','LG','42LN5400','561.74','749','617.91','60.00','7be6b20d0022441fa43ee1e6b4395522.jpg','2014-07-24 01:07:21','Enabled'),(184,726,1,'2','8','40in LED Connect Share Movie 2HDMI 1USB',' 40 inch LED 1920x1080 CMR100 50Hz  ConnectShare Movie  2HDMI  1USB ','Samsung','UA40F5000AMXXY','592.73','749','652.00','60.00','744f45cc8aae5eb6fbe206782231ded9.jpg','2014-07-24 01:07:21','Enabled'),(185,980,1,'2','12','D3200 DSLR Camera +18-55mm VR Black','  Purpose built and designed for budding photographers and camera enthusiasts  the 24.2 Mega pixel high performance Nikon D3200 DSLR camera - Twin Lens Kit comes with a 55 - 300mm lens in addition to its 18 - 55mm lens and utilises the newly developed Nikon DX-format CMOS sensor and EXPEED 3 Image Processing engine and will have you snapping off shots like a professional photographer!    Exceptional Design  The compact and lightweight design of the Nikon D3200 DSLR camera ensures comfortable handling and promotes stable user operation for sharper pictures and minimised blur. Its practical form factor and sensible