5d265b01b74f757a25.jpg','2014-07-24 01:07:21','Enabled'),(470,1420,1,'2','6','AirPlay & DLNA Compatible Wireless Sound System','  Enjoy your music anywhere at any time with this Wireless Speaker from Pioneer. As we&rsquo;re moving into a wireless world  this XW-SMA1 will be perfect for music lovers since it has been integrated with Airplay and Wireless Direct. You can listen to all the music from your Apple or Android smartphone through one of the world&rsquo;s finest speakers from wherever you are.    No Speaker Cables. No Clutter.  This A1 Speaker from Pioneer is one of the most versatile on the market due to its connectivity to both Android and Apple smartphones without having to sync the devices. You can play your music simultaneously from multiple rooms and even from outside your home!  Unlimited Connectivity  The XW-SMA1 supports Apple Airplay to allow you to stream directly to the HiFi System and the dock allows you to simultaneously play your music and charge your Apple device. Wireless Direct is also built in to the speaker which means the XW-SMA1 will act as its own Wi-Fi access point so there&rsquo;s no need to connect to your local network. The high bandwidth carries more audio signal so it won&rsquo;t be obstructed by furniture or walls.  World Renowned Sound  Pioneer&rsquo;s Chief Sound Engineer  Andrew Jones  has designed some of the world&rsquo;s finest speakers. The XW-SMA1 is no exception and will provide you with that same high-end sound. It&rsquo;s not only conveniently portable but you will be impressed with the high fidelity and powerful bass sound it emits.  ','Pioneer','XWSMA1','251.37','399','276.51','15.00','7558dbe007f906aa8069aceef5d38d39.jpg','2014-07-24 01:07:21','Enabled'),(471,1447,1,'2','12','16.1MP Waterproof Shockproof Camera Orange','  Take your camera with you on your adventures now with the Orange Panasonic Lumix DMC-FT5 Tough Digital Camera. The Panasonic Lumix offers a rugged design that allows you to take shots up to 13m underwater  as well as built in Wi-Fi with smartphone connectivity.    Quality Photos  For superb quality photos you can depend on the Lumix digital camera  with a 16.1 high sensitivity MOS sensor  4.6x optical zoom and a 28mm wide angle lens  so that you can always ensure you get the best shot  even in the most intense conditions.  Rugged Design  Capture your adventurous life with the Panasonic Lumix DMC-FT5 camera with its rugged design that is waterproof down to 13m  shockproof up to 2m high  freezeproof down to -10 degrees Celsius  dustproof  and pressure resistant up to 100kg.  Underwater Shots  Now you can take brilliant quality shots underwater with the Lumix camera not only being waterproof  but also having an advanced underwater mode that brings the underwater world to full colour.  Built In Wi-Fi  Connect to the Lumix DMC-FT5 with your smartphone or tablet through a Wi-Fi network and you can not only transfer photos and videos over  but you can also use the smartphone or tablet as a remote controller for the camera.  ','Panasonic','DMCFT5GND','296.07','399','325.68','8.00','156d145c61bb603caaf8e859bf3f12db.jpg','2014-07-24 01:07:21','Enabled'),(472,1464,1,'2','11','PS3 500GB Console + Dual Shock Controller + Uncharted Drakes Fortune + Ratchet & Clank A Crack in Ti',' 500GB M Chassis Console  HD and 3D Capable  All Kinds of Entertainment  Built-in 802.11b/g Wi-Fi  Redesigned Shape.  DualShock Controller - Utilising sensors designed to read when a player angles  tilts  thrusts or pulls  the Dual Shock Controller allows game play to become a natural extension of the player body. Also with the Vibrate/rumble feature.  Uncharted Drakes Fortune - A 400-year-old clue in the coffin of Sir Francis Drake sets a modern-day fortune hunter on an exploration for the fabled treasure of El Dorado  leading to the discovery of a forgotten island in the middle of the Pacific Ocean. The search turns deadly when Nathan Drake becomes stranded on the island and hunted by mercenaries. Outnumbered and outgunned  Drake and his companions must fight to survive as they begin to unravel the terrible secrets hidden on the Island.  Ratchet &amp; Clank A Crack in TIme -&nbsp;In this follow-up to the best-selling series  Ratchet &amp; Clank Future: A Crack in Time puts players into the role of both Ratchet and Clank as they attempt to reunite and save the universe. Along the way  both will finally uncover the hidden truth behind their origins and discover their ultimate destinies. As the duo come closer to reuniting  they&rsquo;ll have to ask themselves the biggest question of all: Do Ratchet and Clank&rsquo;s destinies lie with each other? Or is it finally time for the universe&rsquo;s greatest duo to separate for good? ','Sony','9208464BDLA','330.00','399','363.00','15.00','f177626427f3d55427f6de2944efc6db.jpg','2014-07-24 01:07:21','Enabled'),(473,1465,1,'2','11','PS3 500GB Console + PS3 Dual shock controller Black + Play TV',' PS3 Dual Shock Controller Black - Utilising sensors designed to read when a player angles  tilts  thrusts or pulls  the dual shock controller allows game play to become a natural extension of the player body.  Play TV for PS3 - Watch  pause and record Digital HD TV through your PS3. Twin Digital high definition tuner - watch and record 2 programs at once. Background recording - play games  watch DVD\'s and Blu Rays while recording.  PS3 500GB Chassis - Hd and 3D capable ','Sony','9217824BUNDLEB','330.00','399','363.00','15.00','5f03b37b43f65a39b1010393709dcbe0.jpg','2014-07-24 01:07:21','Enabled'),(474,11,1,'2','6','Outdoor Speaker 50W water resistant Black (PAIR)',' The Indoor/Outdoor 1A2 is a 4 1/2in 2-way speaker in the popular series of versatile models for both indoor and outdoor applications. This compact model has great sonic qualities  elegant design  and a flexible mounting system. The series is popular in commercial installations  for examples in retail outlets. For the private household  these speakers are ideal for