ean you can get hot water and steam for frothing coffee in no time. It also has a dedicated outlet for instant hot water  perfect for long blacks and heating cups.  Professional Extraction  The espresso gauge lets you manage extraction with finesse. By measuring the water pressure on an easy to read dial  you can determine whether the coffee is extracting at the correct pace. The Auto-Purge feature automatically adjusts the water temperature to aid perfect extraction.  ','BES870','0.00','0.00','60.00','799.95','http://www.harveynormancommercial.com.au/media/catalog/product//b/e/bes870.jpg','2014-07-24 01:07:21','Coffee Machines','Enabled','',1),(1502,1,'Personal Care','Triple Action Flex Mens Shaver','Remington','   Intercept trimmer pre-trims multi-day growth    Stainless steel blades    Innovative multi-pattern foil captures and cuts hairs that grow in all directions    Triple Flex Technology    3 independent flexing heads    Multi-directional pivoting head      Cord/Cordless operation    Up to 60 minutes of cordless usage time    1 hour full charge    LED shaving time indicator    Travel lock    Washable  easy to clean head    Worldwide voltage    Pop up trimmer ideal for sideburns  necklines and moustaches    Anti-slip grip   ','FR500AU','0.00','0.00','12.00','149.95','http://www.harveynormancommercial.com.au/media/catalog/product//f/r/fr500au.jpg','2014-07-24 01:07:21','Mens Shavers','Enabled','',1),(1503,1,'Personal Care','Hyper Flex Mens Shaver','Remington','  Hyper Flex technology  multi-directional pivoting neck moves freely to adjust to your neck  chin and jawline  ActiveContour  shaving heads adjust to the contours of your face   PrecisionUltra cutters cut long and short hairs in fewer strokes    Stainless Steel Twin Track Blades  50% more shaving coverage*    Wet / Dry  can be used with shaving creams  even in the shower    Lithium Powered battery    Cordless (rechargeable) operation    4 hour charging time    Up to 50 minutes cordless usage time    Charging indicator light with low battery indicator    Worldwide voltage    Pop up trimmer ideal for necklines  sideburns and moustaches    Charging stand with folding design &amp; water drainage   ','XR1330AU','0.00','0.00','12.00','129.95','http://www.harveynormancommercial.com.au/media/catalog/product//x/r/xr1330au.jpg','2014-07-24 01:07:21','Mens Shavers','Enabled','',1),(1504,1,'Cameras','HERO3 White Edition 1080p  720p video 5MP photos','GoPro',' Capture every moment of your adventures with this HD Hero3 White Edition Camera from GoPro. Smaller and lighter than previous models  this camera doesn\'t compromise on quality with stunning 1080p video recording and sharp 5MP photos at a rate of 3 frames per second. It\'s also waterproof and has wind resistant audio &ndash; you can even control it remotely for accurate recording no matter where you are.  Compact Design -&nbsp;The new GoPro Hero3 camera is 30% smaller and 25% lighter than the Original HD Hero camera for improved portability. It also has a redesigned user interface for more intuitive control over your footage.  Wi-Fi Enabled -&nbsp;For the first time this GoPro camera is Wi-Fi enabled  including the ability to control it remotely. You can either use the optional Wi-Fi Remote* or run the free GoPro app on your smartphone or tablet for live video preview and remote control access so you can time your shots perfectly.  The Right Shot -&nbsp;Get the right shot every time with the impressive performance of this compact camera. Not only is it capable of capturing 1080p 30fps or 720p 60fps video and 5MP photos at a rate of 3 frames per second  but it\'s also waterproof to 60m and uses a reduced-distortion lens for stunning images both above and below the water. It also has wind reduction technology for improved sound on your videos. ','GPCHDHE302','287.10','261.00','8.00','299','http://www.harveynormancommercial.com.au/media/catalog/product//g/p/gpchdhe302.jpg','2014-07-24 01:07:21','Camera Accessories','Enabled'